import React, { useState } from "react";
import { Navbar, Footer } from "./CommonUI";
import "./admindashboard.css";

const AdminDashboard = () => {
  const [sidebarOpen, setSidebarOpen] = useState(false);
  const [isDarkMode, setIsDarkMode] = useState(false);

  const isLoggedIn = true;

  const toggleSidebar = () => setSidebarOpen(!sidebarOpen);
  const toggleDarkMode = () => setIsDarkMode(!isDarkMode);

  // Dummy data
  const totalUsers = 1200;
  const totalQuestions = 350;
  const leaderboard = [
    { name: "Aditi Sharma", score: 98 },
    { name: "Rahul Verma", score: 95 },
    { name: "Sneha Patel", score: 93 },
    { name: "Aman Gupta", score: 90 },
  ];

  return (
    <div className="admin-container">
      <Navbar
        isDarkMode={isDarkMode}
        toggleDarkMode={toggleDarkMode}
        isLoggedIn={isLoggedIn}
      />

      <div className="admin-main">
        {/* Sidebar */}
        <div
          className={`sidebar ${sidebarOpen ? "open" : ""}`}
          style={{ backgroundColor: "#ffffff" }}
        >
          <button className="sidebar-toggle" onClick={toggleSidebar}>
            {sidebarOpen ? "Close" : "‚â°"}
          </button>

          {sidebarOpen && (
            <div className="sidebar-content">
              <h4>Profile</h4>
              <p><strong>Name:</strong> Admin Name</p>
              <p><strong>Email:</strong> admin@example.com</p>
              <p><strong>Role:</strong> Admin</p>
            </div>
          )}
        </div>

        {/* Dashboard Content */}
        <div className="dashboard-content">
          <h1>Admin Dashboard</h1>
          <p>Welcome, Admin! Manage users, questions, and performance analytics here.</p>

          {/* Overview Section */}
          <section className="overview-section">
            <h2>üìä Overview</h2>
            <div className="overview-cards">
              <div className="card">
                <h3>Total Users</h3>
                <p>{totalUsers}</p>
              </div>
              <div className="card">
                <h3>Total Questions</h3>
                <p>{totalQuestions}</p>
              </div>
            </div>
          </section>

          {/* Question Management */}
          <section className="management-section">
            <h2>üßë‚Äçüè´ Question Management</h2>
            <ul>
              <li>Add / Edit / Delete questions</li>
              <li>Categorize by topic: Quantitative, Logical, Verbal, GK, Reasoning</li>
              <li>Upload via Excel or CSV file</li>
            </ul>
          </section>

          {/* User Management */}
          <section className="management-section">
            <h2>üë• User Management</h2>
            <ul>
              <li>View all registered students</li>
              <li>Search users by name or email</li>
              <li>View test history per user</li>
            </ul>
          </section>

          {/* Leaderboard */}
          <section className="leaderboard-section">
            <h2>üèÜ Leaderboard (Top Performers)</h2>
            <table className="leaderboard-table">
              <thead>
                <tr>
                  <th>Rank</th>
                  <th>Name</th>
                  <th>Score</th>
                </tr>
              </thead>
              <tbody>
                {leaderboard.map((user, index) => (
                  <tr key={index}>
                    <td>{index + 1}</td>
                    <td>{user.name}</td>
                    <td>{user.score}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </section>

          {/* Authentication / Session */}
          <section className="management-section">
            <h2>üîí Authentication / Session</h2>
            <ul>
              <li>Manage admin profile</li>
              <li>Change password</li>
              <li>Multiple admin support</li>
            </ul>
          </section>
        </div>
      </div>

      <Footer />
    </div>
  );
};

export default AdminDashboard;
